import React from "react";
// import CardLogin from "../CardLogin"
import "./style.css";

function CreateEvent() {


  return (
    <div className="container">
      {/* <CardLogin /> */}
      <div className="row">
        <div className="col-md-6">
          <div className="card">
            <form className="box">
              <h1>Create Your Event</h1>
              <p className="text-muted"></p>
              <input type="text" name="" placeholder="Title/Activity"></input>
              <input type="location" name="" placeholder="Where: Location"></input>
              <input type="amount" name="" placeholder="Amount of People"></input>
              <input type="description" name="" placeholder="Description"></input>
              <div className="row2">
                <input type="submit" name="" value="Create" href="#"></input>
                {/* <a className="already text-muted" href="/">
                  Already a user?
                </a> */}
              </div>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
}

export default CreateEvent;
